/** @format */

import React from "react";

class MovieList extends React.Component {
  constructor(props) {
    super(props);
    console.log(props.movies);
  }

  render() {
    return (
      <div>
        <p>
          {this.props.movies.forEach(arr => (
            <p>{arr}</p>
          ))}
        </p>
      </div>
    );
  }
}

export default MovieList;
